    const[password,setPassword]= useState(false)

    return (
        <>
            <form>
                <h3>Nombre:</h3>
                <input type="text" />
                <h3>Apellido:</h3>
                <input type="text" />
                <h3>Email:</h3>
                <input type="email" />
                <h3>Password:</h3>
                <input type="password" />
                <br />
                <input type="submit" />
            </form> 
        </>
    )
}

